import React, { Fragment, Component } from 'react';

import { ThemeProvider, injectGlobal } from 'styled-components';
import StyledApp from './app.styled';
import { Board } from './game';



class SudokuGame extends Component {
  state = {
    theme: {
      name: 'Light Orange',
      primary: 'rgba(255,90,0,1)',
      secondary: 'rgba(0,0,0,1)',
      board: 'rgba(255,90,0,0.7)',
      overlay: 'rgba(255,90,0,0.2)',
      background: 'white',
      original: 'rgba(102, 102, 102,1)',
      inverted: 'black',
    },
  };

  render() {
    const { theme } = this.state;
    const {
      onComplete,
      difficulty,
      hide,
      CustomResetModal,
      CustomValidateModal,
    } = this.props;
    return (
      <ThemeProvider theme={theme}>
        <StyledApp>
          <Board
            hide={hide}
            onComplete={onComplete}
            difficulty={difficulty}
            CustomResetModal={CustomResetModal}
            CustomValidateModal={CustomValidateModal}
          />
        </StyledApp>
      </ThemeProvider>
    );
  }
}

export default SudokuGame;
